import React, { Component } from 'react';
import PropTypes from 'prop-types';

class Todo extends Component {

    constructor(props) {

        super(props);
       

    }


    render() {
        return (
            <div className="container bg-light">
               <h2>My Todo list </h2>
               <table className='table table-striped'>
                   <thead className='thead-dark'>
                       <th>Id</th>
                       <th>Description</th>
                       <th>Completed</th>
                       <th>Due Date</th>
                   </thead>
               </table>
            </div>
        );


    }


}





export default Todo;
